import React, { useState, useEffect, useCallback } from 'react';
import styled from 'styled-components';
import { debounce } from 'lodash';
import ReactMarkdown from 'react-markdown';
import { getGPTResponse } from '../utils/gptService';

const ChatContainer = styled.div`
  display: flex;
  flex-direction: column;
  height: 60vh;
  overflow-y: auto;
  background-color: #2a2a2a;
  border-radius: 8px;
  padding: 1rem;
`;

const Message = styled.div`
  background-color: ${props => props.isUser ? '#3c8ce7' : '#4a4a4a'};
  color: #ffffff;
  padding: 0.8rem;
  border-radius: 8px;
  margin-bottom: 1rem;
  align-self: ${props => props.isUser ? 'flex-end' : 'flex-start'};
  max-width: 70%;
  line-height: 1.5;

  p {
    margin-bottom: 0.5rem;
  }

  ul, ol {
    padding-left: 1.5rem;
    margin: 0.5rem 0;
  }

  li {
    margin-bottom: 0.25rem;
  }

  strong {
    font-weight: bold;
  }

  h1, h2, h3, h4, h5, h6 {
    margin-top: 1rem;
    margin-bottom: 0.5rem;
  }
`;

const InputContainer = styled.div`
  display: flex;
  margin-top: 1rem;
`;

const Input = styled.input`
  flex: 1;
  padding: 0.8rem;
  font-size: 1rem;
  border: none;
  border-radius: 4px;
  background-color: #3a3a3a;
  color: #ffffff;
`;

const SendButton = styled.button`
  background-color: #3c8ce7;
  color: #ffffff;
  border: none;
  padding: 0.8rem 1.5rem;
  font-size: 1rem;
  cursor: pointer;
  border-radius: 4px;
  margin-left: 0.5rem;
`;

const AIChat = ({ day, onUpdateSummary }) => {
  const [messages, setMessages] = useState([]);
  const [input, setInput] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const [hasInitialized, setHasInitialized] = useState(false);

  const getAIResponse = useCallback(async (prompt, currentDay, shouldUpdateSummary = false) => {
    setIsLoading(true);
    try {
      const aiResponse = await getGPTResponse(getAIPrompt(prompt, currentDay));
      const aiMessage = { text: aiResponse, isUser: false };
      setMessages(prev => [...prev, aiMessage]);
      if (shouldUpdateSummary) {
        const summary = await getGPTResponse(getSummaryPrompt(prompt, currentDay));
        onUpdateSummary(currentDay, summary);
      }
    } catch (error) {
      console.error('Error getting AI response:', error);
      setMessages(prev => [...prev, { text: "I'm sorry, I encountered an error. Please try again.", isUser: false }]);
    } finally {
      setIsLoading(false);
    }
  }, [onUpdateSummary]);

  useEffect(() => {
    if (!hasInitialized) {
      const initialPrompt = getInitialPrompt(day);
      setMessages([{ text: initialPrompt, isUser: false }]);
      setHasInitialized(true);
    }
  }, [day, hasInitialized]);

  const debouncedHandleSend = useCallback(
    debounce(async () => {
      if (input.trim() && !isLoading) {
        const userMessage = { text: input, isUser: true };
        setMessages(prev => [...prev, userMessage]);
        const currentInput = input;
        setInput('');
        await getAIResponse(currentInput, day, true);
      }
    }, 300),
    [input, isLoading, day, getAIResponse]
  );

  const handleInputChange = (e) => {
    setInput(e.target.value);
  };

  const handleKeyPress = (e) => {
    if (e.key === 'Enter') {
      debouncedHandleSend();
    }
  };

  return (
    <>
        <ChatContainer>
            {messages.map((message, index) => (
              <Message key={index} isUser={message.isUser}>
                  <ReactMarkdown>{message.text}</ReactMarkdown>
              </Message>              ))}
        </ChatContainer>
      <InputContainer>
        <Input
          value={input}
          onChange={handleInputChange}
          onKeyPress={handleKeyPress}
          placeholder="Type your message..."
          disabled={isLoading}
        />
        <SendButton onClick={debouncedHandleSend} disabled={isLoading}>
          {isLoading ? 'Sending...' : 'Send'}
        </SendButton>
      </InputContainer>
    </>
  );
};

const getInitialPrompt = (day) => {
  const prompts = {
    1: "Let's start by defining your long-term goal for this project. What are you aiming to achieve?",
    2: "Great! Now let's sketch out some potential solutions. What ideas do you have?",
    3: "It's time to decide on the best solutions. Which ideas stand out to you?",
    4: "Now we'll build a prototype. What key features should we include?",
    5: "Finally, let's test and learn. What aspects of the prototype do you want to focus on?"
  };
  return prompts[day] || "Let's continue with the sprint. What's on your mind?";
};

const getAIPrompt = (userInput, day) => {
    return `You are an AI assistant helping with a design sprint. It's Day ${day} of the sprint. 
    The user input is: "${userInput}". 
    Provide guidance and ask follow-up questions to help the user progress through this day of the sprint. 
    Be concise but insightful. If appropriate, summarize key points or decisions made.
    Use proper Markdown formatting:
    - Use line breaks to separate paragraphs.
    - Use * or - for bullet points.
    - Use 1. 2. 3. etc. for numbered lists.
    - Use **text** for bold.
    - Use # for main headings and ## for subheadings.
    Ensure your response is well-structured and easy to read.`;
  };

const getSummaryPrompt = (userInput, day) => {
  return `Summarize the key points and decisions made so far on Day ${day} of the sprint. 
  The user input is: "${userInput}". 
  Provide a clear and concise summary that highlights the progress and any important insights.`;
};

export default AIChat;
